import { Route, Routes } from "react-router-dom";
import "./App.css";
import NotFound from "./components/NotFound";
import WaiterBreakfast from "./components/WaiterView/Breakfast";
import Kitchen from "./components/Kitchen";
import WaiterLunch from "./components/WaiterView/Lunch";
import WaiterReady from "./components/WaiterView/OrderReady";

function App() {
  return (
    
      <Routes>
        <Route path="/breakfast" element={<WaiterBreakfast />} />
        <Route path="/lunch" element={<WaiterLunch />} />
        <Route path="/kitchen" element={<Kitchen />} />
        <Route path="/orders" element={<WaiterReady />} />
        <Route path="*" element={<NotFound />} />
      </Routes>
  );
}

export default App;
